create table queued_track
(
  addedAt    datetime          not null,
  id         int auto_increment
    primary key,
  `order`    int               not null,
  playedAt   datetime          null,
  randomized tinyint default 0 not null,
  addedById  varchar(255)      null,
  trackId    varchar(255)      null,
  constraint FK_5a18241074774f9b65cb4636ed8
    foreign key (addedById) references user (id),
  constraint FK_ae28d14aeb9cfb6f83dcc9a4ab5
    foreign key (trackId) references track (id)
);

